package model;


public class Teacher {

	public Teacher() {
		// TODO Auto-generated constructor stub
	}
	private String teachId,teachname,teachEmail,teachPassword,teachQua,teachSub,deptid;
	public String getTeachId() {
		return teachId;
	}
	public void setTeachId(String teachId) {
		this.teachId = teachId;
	}
	public String getTeachname() {
		return teachname;
	}
	public void setTeachname(String teachname) {
		this.teachname = teachname;
	}
	public String getTeachEmail() {
		return teachEmail;
	}
	public void setTeachEmail(String teachEmail) {
		this.teachEmail = teachEmail;
	}
	public String getTeachPassword() {
		return teachPassword;
	}
	public void setTeachPassword(String teachPassword) {
		this.teachPassword = teachPassword;
	}
	public String getTeachQua() {
		return teachQua;
	}
	public void setTeachQua(String teachQua) {
		this.teachQua = teachQua;
	}
	public String getTeachSub() {
		return teachSub;
	}
	public void setTeachSub(String teachSub) {
		this.teachSub = teachSub;
	}
	public String getDeptid() {
		return deptid;
	}
	public void setDeptid(String deptid) {
		this.deptid = deptid;
	}
	
}
